import React, { useState, useEffect } from 'react';

const MovieList = ({ movies = [], editMovie, deleteMovie }) => {
  const [editingId, setEditingId] = useState(null);
  const [editedMovie, setEditedMovie] = useState({ Movie_Name: '', Description: '', Rating: '' });

  useEffect(() => {
    console.log("Movies prop inside MovieList:", movies);
  }, [movies]);

  const handleEdit = (movie) => {
    setEditingId(movie.id);
    setEditedMovie(movie);
  };

  const handleSave = () => {
    if (editedMovie.Movie_Name && editedMovie.Description && !isNaN(editedMovie.Rating)) {
      editMovie(editingId, editedMovie);
      setEditingId(null);
    } else {
      alert("Please fill out all fields correctly.");
    }
  };

  const handleCancel = () => {
    setEditingId(null); // Reset the editing state
    setEditedMovie({ Movie_Name: '', Description: '', Rating: '' });
  };

  return (
    <div>
      {movies.length > 0 ? (
        // Temporarily adding this to check if movies are being passed properly
        movies.map((movie) => (
          <p key={movie.id}>{movie.Movie_Name}</p>  // This will display the movie name as a paragraph
        ))
      ) : (
        <p>No movies to display.</p>
      )}

      {/* Rest of your original table logic can be kept after testing */}
      {movies.length > 0 ? (
        movies.map((movie) => (
          <div key={movie.id} className="movie-item">
            {editingId === movie.id ? (
              <div>
                <input
                  type="text"
                  value={editedMovie.Movie_Name}
                  placeholder="Movie Name"
                  onChange={(e) => setEditedMovie({ ...editedMovie, Movie_Name: e.target.value })}
                />
                <input
                  type="text"
                  value={editedMovie.Description}
                  placeholder="Description"
                  onChange={(e) => setEditedMovie({ ...editedMovie, Description: e.target.value })}
                />
                <input
                  type="number"
                  value={editedMovie.Rating}
                  placeholder="Rating"
                  onChange={(e) => setEditedMovie({ ...editedMovie, Rating: e.target.value })}
                />
                <button onClick={handleSave}>Save</button>
                <button onClick={handleCancel}>Cancel</button>
              </div>
            ) : (
              <div>
                <table>
                  <thead>
                    <tr>
                      <th>Movie Name</th>
                      <th>Description</th>
                      <th>Rating</th>
                      <th>Edit</th>
                      <th>Delete</th>
                    </tr>
                  </thead>
                  <tbody>
                    {movies.map((movie) => (
                      <tr key={movie.id}>
                        <td>{movie.Movie_Name}</td>
                        <td>{movie.Description}</td>
                        <td>{movie.Rating}</td>
                        <td>
                          <button onClick={() => handleEdit(movie)}>Edit</button>
                        </td>
                        <td>
                          <button onClick={() => deleteMovie(movie.id)}>Delete</button>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            )}
          </div>
        ))
      ) : (
        <p>No movies to display.</p>
      )}
    </div>
  );
};

export default MovieList;
